import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter} from 'react-router-dom'//import this to wrap the app in it (routing)om
import {Provider} from 'react-redux'//provider from react redux to wrap the whole app with it and takes store as prop
import {store,persistor} from './redux/store/store'//import also the persisted version of store we defined in it

import {persistGate} from 'redux-persist/integration/react'// import persistGatein index.js to link react to persist 
import './index.css';
import App from './App';


ReactDOM.render(
    <Provider store={store}>
    <BrowserRouter>
    <persistGate persistor={persistor}> {/* we wrap the app inside the persistgate for it to have acces to persisted state */}
    <App />
    </persistGate>
    </BrowserRouter>
    </Provider>
,
 document.getElementById('root'));
